INSERT INTO `fan_introduction` VALUES (1, 'HXD1机车牵引风机', '牵引风机 ', '12002', '2023-04-28 20:26:11', '12002', NULL, '用于HXD1、HXD2、HXD3、韶山系列、南非22E等电力机车牵引电机冷却。', '0', '/fans/img/1_1.jpg', NULL, '牵引电机通风机为电力机车牵引电机提供冷却空气，冷却空气从侧墙进风口百叶窗和进风风道进入牵引风机加压后，经牵引风机支架和软风道，从牵引电机非传动端的进风口进入牵引电机，冷却牵引电机后，从牵引风机传动端排向大气。', '/fans/img/sheet1_1.png');
INSERT INTO `fan_introduction` VALUES (2, 'HXD3机车牵引风机 ', '牵引风机 ', '12002', NULL, '12002', NULL, '用于HXD1、HXD2、HXD3、韶山系列、南非22E等电力机车牵引电机冷却。', '0', '/fans/img/1_2.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (3, '南非22E机车牵引风机 ', '牵引风机 ', '12002', NULL, '12002', NULL, '用于HXD1、HXD2、HXD3、韶山系列、南非22E等电力机车牵引电机冷却。', '0', '/fans/img/1_3.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (4, '冷却塔风机', '冷却塔风机', '', '2023-04-28 20:26:17', '', NULL, '', '0', '/fans/img/2_1.png', NULL, '冷却塔风机应用于冷却塔散热器冷却，风机采用了先进的机翼叶型，并对叶轮叶片、前导叶和后导叶进行了精心布置，使得风机的声功率级低于111dB(A)，并且振动速度低于2.8mm/s。风机电机安装在后导风筒组内的内筒里，并增加了3个径向的支撑杆，大大提高了点击的刚性，减小了风机的振动。', '/fans/img/sheet2_1.png');
INSERT INTO `fan_introduction` VALUES (5, '辅助变压器柜风机', '辅助变压器柜风机', '', '2023-04-28 20:26:23', '', NULL, '', '0', '/fans/img/3_1.png', NULL, '辅助变压器柜风机主要对机械间提供空气，维持机械间微正压。该风机结构紧凑、维修方便、低噪音、低振动。风机机壳为箱型结构，叶轮采用了前向多翼式离心式叶轮结构，压力及流量系数高。风机进风道、叶轮、机壳最优化配置保证了风机压力达到最高、气流噪音达到最低水平。风机选用4级电机，轴承使用寿命长，电机后端通过多根电机支撑板支撑，振动速度有效值低于2.8mm/s。', '/fans/img/sheet2_1.png');
INSERT INTO `fan_introduction` VALUES (6, '动车牵引风机', '牵引风机 ', '', '2023-04-28 20:26:29', '', NULL, '', '1', '/fans/img/4_1.png', NULL, '牵引电机通风机通常采用后弯式离心叶轮，将气流通过轴向导叶整流后由轴向出口输出，其主要特点有：结构简单，无蜗壳，极大的减少了风机所占用的空间；气流方向与叶轮轴线相同，可像轴流风机一样的安装；它吸收了离心式和轴流式风机的优点，性能曲线平坦，风压比轴流风机相对较高；其噪音比轴流风机低，可满足低噪音环境要求。', '/fans/img/sheet4_1.png');
INSERT INTO `fan_introduction` VALUES (7, '标准动车组变压器风机 ', '变压器风机 ', '12002', '2023-04-28 20:26:37', '12002', NULL, '用于 CRH2、CRH5、350km/h 标准化动车组，250km/h 标准化动车组变压器冷却。', '1', '/fans/img/5_1.jpg', NULL, '变压器风机主要用于给变压器系统冷却散热，具有结构紧凑、重量轻的特点。变压器风机按照风机形式可分为轴流式和离心式两种。离心式风机具有高压力、低噪声、结构紧凑的特点，所以大部分的变压器风机均采用离心式风机。轴流式变压器风机具有流量大、结构简单，流量比离心风机相对较高。', '/fans/img/sheet5_1.png');
INSERT INTO `fan_introduction` VALUES (8, '动车组变压器风机 ', '变压器风机 ', '12002', NULL, '12002', NULL, '用于 CRH2、CRH5、350km/h 标准化动车组，250km/h 标准化动车组变压器冷却。', '1', '/fans/img/5_2.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (9, '标动350km/h风机  ', '变流器风机 ', '12002', '2023-04-28 20:26:43', '12002', NULL, '用于 350km/h标准化动车组牵引变流器冷却。', '1', '/fans/img/6_1.jpg', NULL, '牵引变流器风机主要用于变流器中散热器、变压器和功率模块的冷却散热，具有外形紧凑、重量轻、噪声低的特点。变流器风机按照风机型式可分为轴流式和离心式两种，按空间布置可分为吸风式和吹风式两种。根据目前变流器的设计特点和使用要求，因离心式风机具有高压力、低噪声的特点，大多数情形下变流器风机以离心式为主；轴流式主要用于变流器柜体内部循环冷却，风机的流量压力小，以单独冷却小型散热器为主。', '/fans/img/sheet6_1.png');
INSERT INTO `fan_introduction` VALUES (10, 'CRH2辅变流器风机', '变流器风机 ', '12002', NULL, '12002', NULL, '用于 CRH2动车组牵引变流器冷却。', '1', '/fans/img/6_2.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (11, '标准250km/h动车主变流器风机', '变流器风机 ', '12002', '2023-04-28 20:26:05', '12002', NULL, '用于250km/h 标准化动车组牵引变流器冷却。', '1', '/fans/img/6_3.png', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (12, '动车组水冷系统', '冷却塔风机 ', '12002', NULL, '12002', NULL, '牵引变流器水冷系统是集成水泵、风机、管路、热交换器及冷却介质状态监控等必要设备的冷却系统。具有总重量轻、噪音小、抗震能力强、热力性能好、易维护、成本低等特点。', '2', '/fans/img/4_1.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (13, '机车复合冷却塔', '冷却塔风机 ', '12002', NULL, '12002', NULL, '复合冷却塔集变压器油路和逆变器水路的复合散热器、水膨胀箱、辅助油箱、冷却风机、保护装置、布赫继电器和干燥器于一体，具有集成化、模块化、轻量化等特点，采用成熟技术，运行可靠性高等。', '2', '/fans/img/4_2.jpg', NULL, '', '');
INSERT INTO `fan_introduction` VALUES (14, '动车组水冷系统 ', '冷却塔风机 ', '12002', NULL, '12002', NULL, '牵引变流器水冷系统是集成水泵、风机、管路、热交换器及冷却介质状态监控等必要设备的冷却系统。具有总重量轻、噪音小、抗震能力强、热力性能好、易维护、成本低等特点。', '2', '/fans/img/4_3.jpg', NULL, '', '');
